(562, 'Bundle.properties', 'contact.context.dataverse.ending', '\n\n---\n\n{0}\n{1}\n\nGo to dataverse {2}/dataverse/{3}\n\nYou received this email because you have been listed as a contact for the dataverse. If you believe this was an error, please contact {4} at {5}. To respond directly to the individual who sent the message, simply reply to this email.', '"\n\n---\n\n{0}\n{1}\n\nVá para o dataverse {2}/dataverse/{3}\n\nVocê recebeu este e-mail porque foi listado como um contato para o dataverse. Se você acredita que isso foi um erro, entre em contato com {4} em {5}. Para responder diretamente ao indivíduo que enviou a mensagem, basta responder a este e-mail.\n"', '2019-08-07 12:57:16', 0),
(563, 'Bundle.properties', 'contact.context.dataverse.noContact', 'There is no contact address on file for this dataverse so this message is being sent to the system address.\n\n', 'Não há nenhum endereço de contato no arquivo para este dataverse então esta mensagem está sendo enviada para o endereço do sistema.', '2019-08-07 12:57:16', 0),
(564, 'Bundle.properties', 'contact.context.dataset.greeting.helloFirstLast', 'Hello {0} {1},', 'Olá {0} {1},', '2019-08-07 12:57:16', 0),
