(566, 'Bundle.properties', 'contact.context.dataset.intro', '{0}\n\nYou have just been sent the following message from {1} via the {2} hosted dataset titled "{3}" ({4}):\n\n---\n\n', '"{0}\n\nVocê acabou de receber a seguinte mensagem de {1} através do conjunto de dados {2} hospedado intitulado ""{3}"" ({4}):\n\n---\n\n"', '2019-08-07 12:57:16', 0),
(567, 'Bundle.properties', 'contact.context.dataset.ending', '\n\n---\n\n{0}\n{1}\n\nGo to dataset {2}/dataset.xhtml?persistentId={3}\n\nYou received this email because you have been listed as a contact for the dataset. If you believe this was an error, please contact {4} at {5}. To respond directly to the individual who sent the message, simply reply to this email.', '"\n\n---\n\n{0}\n{1}\n\nVá para o conjunto de dados {2}/dataset.xhtml?persistentId={3}\n\nVocê recebeu este e-mail porque foi listado como um contato para o conjunto de dados. Se você acredita que isso foi um erro, entre em contato com {4} em {5}. Para responder diretamente ao indivíduo que enviou a mensagem, basta responder a este e-mail."', '2019-08-07 12:57:16', 0),
(568, 'Bundle.properties', 'contact.context.dataset.noContact', 'There is no contact address on file for this dataset so this message is being sent to the system address.\n\n---\n\n', '"Não há um endereço de contato no arquivo para este conjunto de dados, portanto, esta mensagem está sendo enviada para o endereço do sistema.\n---\n"', '2019-08-07 12:57:16', 0),
(569, 'Bundle.properties', 'contact.context.file.intro', '{0}\n\nYou have just been sent the following message from {1} via the {2} hosted file named "{3}" from the dataset titled "{4}" ({5}):\n\n---\n\n', '"{0}\n\nVocê acabou de receber a seguinte mensagem de {1} por meio do arquivo {2} hospedado chamado ""{3}"" do conjunto de dados intitulado ""{4}"" ({5}):\n\n---\n\n"', '2019-08-07 12:57:16', 0),
(570, 'Bundle.properties', 'contact.context.file.ending', '\n\n---\n\n{0}\n{1}\n\nGo to file {2}/file.xhtml?fileId={3}\n\nYou received this email because you have been listed as a contact for the dataset. If you believe this was an error, please contact {4} at {5}. To respond directly to the individual who sent the message, simply reply to this email.', '"\n\n---\n\n{0}\n{1}\n\nVá para o arquivo {2}/file.xhtml?fileId={3}\n\nVocê recebeu este e-mail porque foi listado como um contato para o conjunto de dados. Se você acredita que isso foi um erro, entre em contato com {4} em {5}. Para responder diretamente ao indivíduo que enviou a mensagem, basta responder a este e-mail."', '2019-08-07 12:57:16', 0),
(571, 'Bundle.properties', 'contact.context.support.intro', '{0},\n\nThe following message was sent from {1}.\n\n---\n\n', '"{0},\n\nA seguinte mensagem foi enviada de {1}.\n\n---\n\n\n"', '2019-08-07 12:57:16', 0),
