(721, 'Bundle.properties', 'auth.providers.orcid.helpmessage1', 'ORCID is an open, non-profit, community-based effort to provide a registry of unique researcher identifiers and a transparent method of linking research activities and outputs to these identifiers. ORCID is unique in its ability to reach across disciplines, research sectors, and national boundaries and its cooperation with other identifier systems. Find out more at <a href="https://orcid.org/about" target="_blank">orcid.org/about</a>.', 'O ORCID é um esforço aberto, sem fins lucrativos, com base na comunidade, para fornecer um registro de identificadores exclusivos de pesquisadores e um método transparente de vincular atividades de pesquisa e resultados a esses identificadores. A ORCID é única em sua capacidade de atingir disciplinas, setores de pesquisa e fronteiras nacionais e sua cooperação com outros sistemas de identificadores. Saiba mais em <a href="https://orcid.org/about" target="_blank">orcid.org/about</a>.', '2019-08-07 12:57:16', 0),
(722, 'Bundle.properties', 'auth.providers.orcid.helpmessage2', 'This repository uses your ORCID for authentication (so you don´t need another username/password combination).  Having your ORCID associated with your datasets also makes it easier for people to find the datasets you have published.', 'Este repositório usa seu ORCID para autenticação (para que você não precise de outra combinação de nome de usuário/senha). Ter seu ORCID associado aos seus conjuntos de dados também facilita a localização dos conjuntos de dados que você publicou.', '2019-08-07 12:57:16', 0),
