(855, 'Bundle.properties', 'harvestclients.newClientDialog.oaiSets.helptext', 'Selecting "none" will harvest the default set, as defined by the server. Often this will be the entire body of content across all sub-sets.', 'Selecionar "nenhum" coletará o conjunto padrão, conforme definido pelo servidor. Geralmente, isso será o corpo inteiro do conteúdo em todos os subconjuntos.', '2019-08-07 12:57:16', 0),
(856, 'Bundle.properties', 'harvestclients.newClientDialog.oaiSets.helptext.noset', 'This OAI server does not support named sets. The entire body of content offered by the server will be harvested.', 'Esse servidor OAI não suporta conjuntos nomeados. Todo o conteúdo oferecido pelo servidor será coletado.', '2019-08-07 12:57:16', 0),
