(859, 'Bundle.properties', 'harvestclients.newClientDialog.oaiMetadataFormat.required', 'Please select the metadata format to harvest from this archive.', 'Selecione o formato de metadados para colher deste arquivo.', '2019-08-07 12:57:16', 0),
