(876, 'Bundle.properties', 'harvestclients.newClientDialog.harvestingStyle.tip', 'Type of remote archive.', 'Tipo de arquivo remoto.', '2019-08-07 12:57:16', 0),
(877, 'Bundle.properties', 'harvestclients.newClientDialog.harvestingStyle.helptext', 'Select the archive type that best describes this remote server in order to properly apply formatting rules and styles to the harvested metadata as they are shown in the search results. Note that improperly selecting the type of the remote archive can result in incomplete entries in the search results, and a failure to redirect the user to the archival source of the data.', 'Selecione o tipo de arquivo que melhor descreve esse servidor remoto para aplicar corretamente regras de formatação e estilos aos metadados coletados, conforme exibidos nos resultados da pesquisa. Observe que a seleção indevida do tipo do arquivo remoto pode resultar em entradas incompletas nos resultados da pesquisa e uma falha no redirecionamento do usuário para a origem de arquivamento dos dados.', '2019-08-07 12:57:16', 0),
