(881, 'Bundle.properties', 'harvestclients.viewEditDialog.archiveUrl.helptext', 'Edit if this URL differs from the Server URL.', 'Edite se esse URL for diferente da URL do servidor.', '2019-08-07 12:57:16', 0),
