(884, 'Bundle.properties', 'harvestclients.viewEditDialog.archiveDescription.default.generic', 'This Dataset is harvested from our partners. Clicking the link will take you directly to the archival source of the data.', 'Este conjunto de dados é colhido de nossos parceiros. Clicar no link levará você diretamente para a fonte de arquivamento dos dados.', '2019-08-07 12:57:16', 0),
