(1016, 'Bundle.properties', 'notification.email.welcome', 'Welcome to {0}! Get started by adding or finding data. Have questions? Check out the User Guide at {1}/{2}/user or contact {3} at {4} for assistance.', 'Bem-vindo a {0}! Comece por adicionar ou encontrar dados. Tem perguntas? Confira o Guia do Usuário em {1}/{2}/user ou entre em contato com {3} em {4} para obter ajuda.', '2019-08-07 12:57:16', 0),
(1017, 'Bundle.properties', 'notification.email.welcomeConfirmEmailAddOn', '\n\nPlease verify your email address at {0} . Note, the verify link will expire after {1}. Send another verification email by visiting your account page.', '"Por favor, verifique seu endereço de e-mail em {0}. Observe que o link de verificação expirará após {1}. Envie outro e-mail de verificação visitando a página da sua conta."', '2019-08-07 12:57:16', 0),
(1018, 'Bundle.properties', 'notification.email.requestFileAccess', 'File access requested for dataset: {0} by {1} ({2}). Manage permissions at {3}.', 'Acesso de arquivo solicitado para o conjunto de dados: {0} por {1} ({2}). Gerenciar permissões em {3}.', '2019-08-07 12:57:16', 0),
(1019, 'Bundle.properties', 'notification.email.grantFileAccess', 'Access granted for files in dataset: {0} (view at {1}).', 'Acesso concedido para arquivos no conjunto de dados: {0} (exibição em {1}).', '2019-08-07 12:57:16', 0),
(1020, 'Bundle.properties', 'notification.email.rejectFileAccess', 'Your request for access was rejected for the requested files in the dataset: {0} (view at {1}). If you have any questions about why your request was rejected, you may reach the dataset owner using the "Contact" link on the upper right corner of the dataset page.', 'Sua solicitação de acesso foi rejeitada para os arquivos solicitados no conjunto de dados: {0} (exibição em {1}). Se você tiver alguma dúvida sobre o motivo de sua solicitação ter sido rejeitada, entre em contato com o proprietário do conjunto de dados usando o link "Contato" no canto superior direito da página do conjunto de dados.', '2019-08-07 12:57:16', 0),
(1021, 'Bundle.properties', 'notification.email.createDataverse', 'Your new dataverse named {0} (view at {1} ) was created in {2} (view at {3} ). To learn more about what you can do with your dataverse, check out the Dataverse Management - User Guide at {4}/{5}/user/dataverse-management.html .', 'Seu novo dataverse chamado {0} (view at {1}) foi criado em {2} (view at {3}). Para saber mais sobre o que você pode fazer com o seu dataverse, confira o Gerenciamento do Dataverse - Guia do Usuário em {4}/{5}/user/dataverse-management.html.', '2019-08-07 12:57:16', 0),
(1022, 'Bundle.properties', 'notification.email.createDataset', 'Your new dataset named {0} (view at {1} ) was created in {2} (view at {3} ). To learn more about what you can do with a dataset, check out the Dataset Management - User Guide at {4}/{5}/user/dataset-management.html .', 'Seu novo conjunto de dados denominado {0} (exibição em {1}) foi criado em {2} (exibição em {3}). Para saber mais sobre o que você pode fazer com um conjunto de dados, confira o Gerenciamento de Conjunto de Dados - Guia do Usuário em {4}/{5}/user/dataset-management.html.', '2019-08-07 12:57:16', 0),
(1023, 'Bundle.properties', 'notification.email.wasSubmittedForReview', '{0} (view at {1}) was submitted for review to be published in {2} (view at {3}). Don´´t forget to publish it or send it back to the contributor, {4} ({5})!', '{0} (visão em {1}) foi submetido para revisão para ser publicado em {2} (ver em {3}). Não se esqueça de publicá-lo ou enviá-lo de volta para o colaborador, {4} ({5})!', '2019-08-07 12:57:16', 0),
(1024, 'Bundle.properties', 'notification.email.wasReturnedByReviewer', '{0} (view at {1}) was returned by the curator of {2} (view at {3}).', '{0} (visão em {1}) foi retornado pelo curador de {2} (veja em {3}).', '2019-08-07 12:57:16', 0),
(1025, 'Bundle.properties', 'notification.email.wasPublished', '{0} (view at {1}) was published in {2} (view at {3}).', '{0} (ver em {1}) foi publicado em {2} (ver em {3}).', '2019-08-07 12:57:16', 0),
(1026, 'Bundle.properties', 'notification.email.worldMap.added', '{0} (view at {1}) had WorldMap layer data added to it.', '{0} (vista em {1}) tinha dados da camada do WorldMap adicionados a ele.', '2019-08-07 12:57:16', 0),
(1027, 'Bundle.properties', 'notification.email.closing', '\n\nYou may contact us for support at {0}.\n\nThank you,\n{1}', '"\n\n\nVocê pode nos contatar para suporte em {0}.\n\nObrigado,\n{1}"', '2019-08-07 12:57:16', 0),
