(1030, 'Bundle.properties', 'notification.email.changeEmail', 'Hello, {0}.{1}\n\nPlease contact us if you did not intend this change or if you need assistance.', '"Olá, {0}.{1}\n\nPor favor, entre em contato conosco se você não pretendeu essa mudança ou se precisar de ajuda."', '2019-08-07 12:57:16', 0),
(1031, 'Bundle.properties', 'notification.email.passwordReset', 'Hi {0},\n\nSomeone, hopefully you, requested a password reset for {1}.\n\nPlease click the link below to reset your Dataverse account password:\n\n {2} \n\n The link above will only work for the next {3} minutes.\n\n Please contact us if you did not request this password reset or need further help.', '"Olá, {0},\n\nAlguém, esperamos que você, solicitou uma redefinição de senha para {1}.\n\nPor favor, clique no link abaixo para redefinir sua senha da conta Dataverse:\n\n{2}\n\nO link acima só funcionará pelos próximos {3} minutos.\n\nEntre em contato conosco se você não solicitou essa redefinição de senha ou precisa de mais ajuda."', '2019-08-07 12:57:16', 0),
