(1386, 'Bundle.properties', 'dataset.manageTemplates.noTemplates.why.reason1', 'Templates are useful when you have several datasets that have the same information in multiple metadata fields that you would prefer not to have to keep manually typing in.', 'Os modelos são úteis quando você tem vários conjuntos de dados que possuem as mesmas informações em vários campos de metadados que você preferiria não ter que digitar manualmente.', '2019-08-07 12:57:16', 0),
(1387, 'Bundle.properties', 'dataset.manageTemplates.noTemplates.why.reason2', 'Templates can be used to input instructions for those uploading datasets into your dataverse if you have a specific way you want a metadata field to be filled out.', 'Os modelos podem ser usados para inserir instruções para aqueles que carregam conjuntos de dados em seu dataverse se você tiver uma maneira específica de desejar que um campo de metadados seja preenchido.', '2019-08-07 12:57:16', 0),
(1388, 'Bundle.properties', 'dataset.manageTemplates.noTemplates.how.header', 'How To Use Templates', 'Como usar modelos', '2019-08-07 12:57:16', 0),
(1389, 'Bundle.properties', 'dataset.manageTemplates.noTemplates.how.tip1', 'Templates are created at the dataverse level, can be deleted (so it does not show for future datasets), set to default (not required), and can be copied so you do not have to start over when creating a new template with similar metadata from another template. When a template is deleted, it does not impact the datasets that have used the template already.', 'Os modelos são criados no nível do histórico, podem ser excluídos (por isso não são exibidos em conjuntos de dados futuros), definidos como padrão (não obrigatório) e podem ser copiados para que você não precise recomeçar ao criar um novo modelo com metadados semelhantes de outro modelo. Quando um modelo é excluído, ele não afeta os conjuntos de dados que já usaram o modelo.', '2019-08-07 12:57:16', 0),
(1390, 'Bundle.properties', 'dataset.manageTemplates.noTemplates.how.tip2', 'Please note that the ability to choose which metadata fields are hidden, required, or optional is done on the <a href="/dataverse/{0}?editMode=INFO" title="Dataverse General Information">General Information</a> page for this dataverse.', 'Observe que a capacidade de escolher quais campos de metadados estão ocultos, obrigatórios ou opcionais é feita nas <a href="/dataverse/{0}?editMode=INFO" title="Dataverse Informações gerais">Informações gerais</a> página para este dataverse.', '2019-08-07 12:57:16', 0),
