(1457, 'Bundle.properties', 'dataset.manageGuestbooks.noGuestbooks.why.reason1', 'Guestbooks allow you to collect data about who is downloading the files from your datasets. You can decide to collect account information (username, given name & last name, affiliation, etc.) as well as create custom questions (e.g., What do you plan to use this data for?).', 'Os livros de visitas permitem que você colete dados sobre quem está baixando os arquivos de seus conjuntos de dados. Você pode decidir coletar informações da conta (nome de usuário, nome e sobrenome, afiliação, etc.), além de criar perguntas personalizadas (por exemplo, para que você pretende usar esses dados?).', '2019-08-07 12:57:16', 0),
(1458, 'Bundle.properties', 'dataset.manageGuestbooks.noGuestbooks.why.reason2', 'You can download the data collected from the enabled guestbooks to be able to store it outside of Dataverse.', 'Você pode baixar os dados coletados dos livros de visitas ativados para poder armazená-los fora do Dataverse.', '2019-08-07 12:57:16', 0),
