(1461, 'Bundle.properties', 'dataset.manageGuestbooks.noGuestbooks.how.tip2', 'Custom questions can have free form text answers or have a user select an answer from several options.', 'Perguntas personalizadas podem ter respostas de texto de forma livre ou fazer com que o usuário selecione uma resposta dentre várias opções.', '2019-08-07 12:57:16', 0),
