(1784, 'Bundle.properties', 'file.rsyncUpload.info', 'Upload files using rsync + SSH. This method is recommended for large file transfers. Follow the steps below to upload your data. (<a href="{0}/{1}/user/dataset-management.html#rsync-ssh-upload" title="User Guide - rsync Upload" target="_blank">User Guide - rsync Upload</a>).', 'Carregue arquivos usando rsync + SSH. Esse método é recomendado para transferências de arquivos grandes. Siga os passos abaixo para enviar seus dados. (<a href="{0}/{1}/user/dataset-management.html#rsync-ssh-upload" title="Guia do usuário-upload do rsync" target="_blank">Guia do usuário - Upload do rsync</a>).', '2019-08-07 12:57:17', 0),
(1785, 'Bundle.properties', 'file.rsyncUpload.filesExist', 'You cannot upload additional files to this dataset. A dataset can only hold one data package. If you need to replace the data package in this dataset, please contact {0}.', 'Você não pode carregar arquivos adicionais para este conjunto de dados. Um conjunto de dados pode conter apenas um pacote de dados. Se você precisar substituir o pacote de dados neste conjunto de dados, entre em contato com {0}.', '2019-08-07 12:57:17', 0),
(1786, 'Bundle.properties', 'file.rsyncUpload.noScriptBroken', 'The Data Capture Module failed to generate the rsync script. Please contact {0}.', 'O Módulo de Captura de Dados falhou ao gerar o script rsync. Por favor, entre em contato com {0}.', '2019-08-07 12:57:17', 0),
(1787, 'Bundle.properties', 'file.rsyncUpload.noScriptBusy', 'Currently generating rsync script. If the script takes longer than ten minutes to generate, please contact {0}.', 'Atualmente gerando o script rsync. Se o script demorar mais de dez minutos para gerar, entre em contato com {0}.', '2019-08-07 12:57:17', 0),
