(1910, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfAccess.addInfo.studyCompletion.title', 'Relationship of the data collected to the amount of data coded and stored in the Dataset. Information as to why certain items of collected information were not included in the dataset or a specific data file should be provided.', 'Relação dos dados coletados com a quantidade de dados codificados e armazenados no Dataset. Informações sobre por que certos itens de informações coletadas não foram incluídos no conjunto de dados ou em um arquivo de dados específico devem ser fornecidos.', '2019-08-07 12:57:17', 0),
