(2635, 'citation.properties', 'datasetfieldtype.title.description', 'Full title by which the Dataset is known.', 'Título completo pelo qual o conjunto de dados é conhecido.', '2019-08-07 16:58:47', 0),
(2636, 'citation.properties', 'datasetfieldtype.subtitle.description', 'A secondary title used to amplify or state certain limitations on the main title.', 'Um título secundário usado para amplificar ou afirmar certas limitações no título principal.', '2019-08-07 16:58:47', 0),
(2637, 'citation.properties', 'datasetfieldtype.alternativeTitle.description', 'A title by which the work is commonly referred, or an abbreviation of the title.', 'Um título pelo qual o trabalho é comumente referido ou uma abreviação do título.', '2019-08-07 16:58:47', 0),
(2638, 'citation.properties', 'datasetfieldtype.alternativeURL.description', 'A URL where the dataset can be viewed, such as a personal or project website.', 'Uma URL em que o conjunto de dados pode ser visualizado, como um site pessoal ou de projeto.', '2019-08-07 16:58:47', 0),
(2639, 'citation.properties', 'datasetfieldtype.otherId.description', 'Another unique identifier that identifies this Dataset (e.g., producer´s or another repository´s number).', 'Outro identificador exclusivo que identifica este conjunto de dados (por exemplo, o número do produtor ou de outro repositório).', '2019-08-07 16:58:47', 0),
(2640, 'citation.properties', 'datasetfieldtype.otherIdAgency.description', 'Name of agency which generated this identifier.', 'Nome da agência que gerou este identificador.', '2019-08-07 16:58:47', 0),
(2641, 'citation.properties', 'datasetfieldtype.otherIdValue.description', 'Other identifier that corresponds to this Dataset.', 'Outro identificador que corresponde a este conjunto de dados.', '2019-08-07 16:58:47', 0),
(2642, 'citation.properties', 'datasetfieldtype.author.description', 'The person(s), corporate body(ies), or agency(ies) responsible for creating the work.', 'A pessoa(s), corpo(s) corporativo(s) ou agência(s) responsável(is) pela criação do trabalho.', '2019-08-07 16:58:47', 0),
(2643, 'citation.properties', 'datasetfieldtype.authorName.description', 'The author´s Family Name, Given Name or the name of the organization responsible for this Dataset.', 'O nome de família do autor, o nome próprio ou o nome da organização responsável por este conjunto de dados.', '2019-08-07 16:58:47', 0),
(2644, 'citation.properties', 'datasetfieldtype.authorAffiliation.description', 'The organization with which the author is affiliated.', 'A organização com a qual o autor é afiliado.', '2019-08-07 16:58:47', 0),
(2645, 'citation.properties', 'datasetfieldtype.authorIdentifierScheme.description', 'Name of the identifier scheme (ORCID, ISNI).', 'Nome do esquema identificador (ORCID, ISNI).', '2019-08-07 16:58:47', 0),
(2646, 'citation.properties', 'datasetfieldtype.authorIdentifier.description', 'Uniquely identifies an individual author or organization, according to various schemes.', 'Identifica exclusivamente um autor ou organização individual, de acordo com vários esquemas.', '2019-08-07 16:58:47', 0),
(2647, 'citation.properties', 'datasetfieldtype.datasetContact.description', 'The contact(s) for this Dataset.', 'O(s) contato(s) para este conjunto de dados.', '2019-08-07 16:58:47', 0),
(2648, 'citation.properties', 'datasetfieldtype.datasetContactName.description', 'The contact´s Family Name, Given Name or the name of the organization.', 'Nome de família do contato, nome ou nome da organização.', '2019-08-07 16:58:47', 0),
(2649, 'citation.properties', 'datasetfieldtype.datasetContactAffiliation.description', 'The organization with which the contact is affiliated.', 'A organização com a qual o contato é afiliado.', '2019-08-07 16:58:47', 0),
(2650, 'citation.properties', 'datasetfieldtype.datasetContactEmail.description', 'The e-mail address(es) of the contact(s) for the Dataset. This will not be displayed.', 'O(s) endereço(s) de e-mail do(s) contato(s) para o conjunto de dados. Isso não será exibido.', '2019-08-07 16:58:47', 0),
(2651, 'citation.properties', 'datasetfieldtype.dsDescription.description', 'A summary describing the purpose, nature, and scope of the Dataset.', 'Um resumo descrevendo a finalidade, a natureza e o escopo do conjunto de dados.', '2019-08-07 16:58:47', 0),
(2652, 'citation.properties', 'datasetfieldtype.dsDescriptionValue.description', 'A summary describing the purpose, nature, and scope of the Dataset.', 'Um resumo descrevendo o propósito, a natureza e o escopo do conjunto de dados.', '2019-08-07 16:58:47', 0),
(2653, 'citation.properties', 'datasetfieldtype.dsDescriptionDate.description', 'In cases where a Dataset contains more than one description (for example, one might be supplied by the data producer and another prepared by the data repository where the data are deposited), the date attribute is used to distinguish between the two descriptions. The date attribute follows the ISO convention of YYYY-MM-DD.', 'Nos casos em que um Dataset contém mais de uma descrição (por exemplo, um pode ser fornecido pelo produtor de dados e outro preparado pelo repositório de dados onde os dados são depositados), o atributo data é usado para distinguir entre as duas descrições . O atributo data segue a convenção ISO de AAAA-MM-DD.', '2019-08-07 16:58:47', 0),
(2654, 'citation.properties', 'datasetfieldtype.subject.description', 'Domain-specific Subject Categories that are topically relevant to the Dataset.', 'Categorias de assunto específicas do domínio que são relevantes para o conjunto de dados.', '2019-08-07 16:58:47', 0),
(2655, 'citation.properties', 'datasetfieldtype.keyword.description', 'Key terms that describe important aspects of the Dataset.', 'Termos-chave que descrevem aspectos importantes do conjunto de dados.', '2019-08-07 16:58:47', 0),
(2656, 'citation.properties', 'datasetfieldtype.keywordValue.description', 'Key terms that describe important aspects of the Dataset. Can be used for building keyword indexes and for classification and retrieval purposes. A controlled vocabulary can be employed. The vocab attribute is provided for specification of the controlled vocabulary in use, such as LCSH, MeSH, or others. The vocabURI attribute specifies the location for the full controlled vocabulary.', 'Termos-chave que descrevem aspectos importantes do conjunto de dados. Pode ser usado para criar índices de palavras-chave e para propósitos de classificação e recuperação. Um vocabulário controlado pode ser empregado. O atributo vocab é fornecido para especificação do vocabulário controlado em uso, como LCSH, MeSH ou outros. O atributo vocabURI especifica a localização do vocabulário controlado completo.', '2019-08-07 16:58:47', 0),
(2657, 'citation.properties', 'datasetfieldtype.keywordVocabulary.description', 'For the specification of the keyword controlled vocabulary in use, such as LCSH, MeSH, or others.', 'Para a especificação do vocabulário controlado por palavras-chave em uso, como LCSH, MeSH ou outros.', '2019-08-07 16:58:47', 0),
(2658, 'citation.properties', 'datasetfieldtype.keywordVocabularyURI.description', 'Keyword vocabulary URL points to the web presence that describes the keyword vocabulary, if appropriate. Enter an absolute URL where the keyword vocabulary web site is found, such as http://www.my.org.', 'A URL do vocabulário de palavras-chave aponta para a presença na Web que descreve o vocabulário de palavras-chave, se apropriado. Insira Uma URL absoluto no qual o site do vocabulário de palavras-chave é encontrado, como http://www.my.org.', '2019-08-07 16:58:47', 0),
(2659, 'citation.properties', 'datasetfieldtype.topicClassification.description', 'The classification field indicates the broad important topic(s) and subjects that the data cover. Library of Congress subject terms may be used here.', 'O campo de classificação indica o(s) tópico(s) e assuntos importantes abrangidos pelos dados. Termos do assunto da Biblioteca do Congresso podem ser usados aqui.', '2019-08-07 16:58:47', 0),
(2660, 'citation.properties', 'datasetfieldtype.topicClassValue.description', 'Topic or Subject term that is relevant to this Dataset.', 'Tópico ou termo do assunto que é relevante para este conjunto de dados.', '2019-08-07 16:58:48', 0),
(2661, 'citation.properties', 'datasetfieldtype.topicClassVocab.description', 'Provided for specification of the controlled vocabulary in use, e.g., LCSH, MeSH, etc.', 'Fornecido para especificação do vocabulário controlado em uso, por exemplo, LCSH, MeSH, etc.', '2019-08-07 16:58:48', 0),
(2662, 'citation.properties', 'datasetfieldtype.topicClassVocabURI.description', 'Specifies the URL location for the full controlled vocabulary.', 'Especifica o local da URL para o vocabulário controlado completo.', '2019-08-07 16:58:48', 0),
(2663, 'citation.properties', 'datasetfieldtype.publication.description', 'Publications that use the data from this Dataset.', 'Publicações que usam os dados deste conjunto de dados.', '2019-08-07 16:58:48', 0),
(2664, 'citation.properties', 'datasetfieldtype.publicationCitation.description', 'The full bibliographic citation for this related publication.', 'A citação bibliográfica completa para esta publicação relacionada.', '2019-08-07 16:58:48', 0),
(2665, 'citation.properties', 'datasetfieldtype.publicationIDType.description', 'The type of digital identifier used for this publication (e.g., Digital Object Identifier (DOI)).', 'O tipo de identificador digital usado para esta publicação (por exemplo, Digital Object Identifier (DOI)).', '2019-08-07 16:58:48', 0),
(2666, 'citation.properties', 'datasetfieldtype.publicationIDNumber.description', 'The identifier for the selected ID type.', 'O identificador para o tipo de ID selecionado.', '2019-08-07 16:58:48', 0),
(2667, 'citation.properties', 'datasetfieldtype.publicationURL.description', 'Link to the publication web page (e.g., journal article page, archive record page, or other).', 'Link para a página da web da publicação (por exemplo, página de artigo de periódico, página de registro de arquivo ou outro).', '2019-08-07 16:58:48', 0),
(2668, 'citation.properties', 'datasetfieldtype.notesText.description', 'Additional important information about the Dataset.', 'Informações adicionais importantes sobre o conjunto de dados.', '2019-08-07 16:58:48', 0),
(2669, 'citation.properties', 'datasetfieldtype.language.description', 'Language of the Dataset', 'Idioma do conjunto de dados', '2019-08-07 16:58:48', 0),
(2670, 'citation.properties', 'datasetfieldtype.producer.description', 'Person or organization with the financial or administrative responsibility over this Dataset', 'Pessoa ou organização com responsabilidade financeira ou administrativa sobre este conjunto de dados', '2019-08-07 16:58:48', 0),
(2671, 'citation.properties', 'datasetfieldtype.producerName.description', 'Producer name', 'Nome do produtor', '2019-08-07 16:58:48', 0),
