(4717, 'socialscience.properties', 'datasetfieldtype.unitOfAnalysis.description', 'Basic unit of analysis or observation that this Dataset describes, such as individuals, families/households, groups, institutions/organizations, administrative units, and more. For information about the DDI´s controlled vocabulary for this element, please refer to the DDI web page at http://www.ddialliance.org/controlled-vocabularies.', 'Unidade básica de análise ou observação descrita neste conjunto de dados, como indivíduos, famílias/agregado familiar, grupos, instituições/organizações, unidades administrativas e muito mais. Para obter informações sobre o vocabulário controlado da DDI para este elemento, por favor, consulte a página da DDI em http://www.ddialliance.org/controlled-vocabularies.', '2019-08-07 17:26:02', 0),
(4718, 'socialscience.properties', 'datasetfieldtype.universe.description', 'Description of the population covered by the data in the file., the group of people or other elements that are the object of the study and to which the study results refer. Age, nationality, and residence commonly help to  delineate a given universe, but any number of other factors may be used, such as age limits, sex, marital status, race, ethnic group, nationality, income, veteran status, criminal convictions, and more. The universe may consist of elements other than persons, such as housing units, court cases, deaths, countries, and so on. In general, it should be possible to tell from the description of the universe whether a given individual or element is a member of the population under study. Also known as the universe of interest, population of interest, and target population.', 'Descrição da população coberta pelos dados no arquivo, O grupo de pessoas ou outros elementos que são objeto do estudo e aos quais os resultados do estudo se referem. Idade, nacionalidade e residência geralmente ajudam a delinear um determinado universo, mas vários outros fatores podem ser usados, como limites de idade, sexo, estado civil, raça, etnia, nacionalidade, renda, condição de veterano, condenações criminais e mais. O universo pode consistir em elementos que não sejam pessoas, como unidades habitacionais, processos judiciais, mortes, países e assim por diante. Em geral, deve ser possível dizer, a partir da descrição do universo, se um determinado indivíduo ou elemento é um membro da população em estudo. Também conhecido como universo de interesse, população de interesse e população-alvo.', '2019-08-07 17:26:02', 0),
(4719, 'socialscience.properties', 'datasetfieldtype.timeMethod.description', 'The time method or time dimension of the data collection, such as panel, cross-sectional, trend, time- series, or other.', 'O método de tempo ou dimensão de tempo da coleta de dados, como painel, corte transversal, tendência, série temporal ou outro.', '2019-08-07 17:26:02', 0),
(4720, 'socialscience.properties', 'datasetfieldtype.dataCollector.description', 'Individual, agency or organization responsible for  administering the questionnaire or interview or compiling the data.', 'Individual, agência ou organização responsável pela administração do questionário ou entrevista ou compilação dos dados.', '2019-08-07 17:26:02', 0),
(4721, 'socialscience.properties', 'datasetfieldtype.collectorTraining.description', 'Type of training provided to the data collector', 'Tipo de treinamento fornecido ao coletor de dados', '2019-08-07 17:26:02', 0),
(4722, 'socialscience.properties', 'datasetfieldtype.frequencyOfDataCollection.description', 'If the data collected includes more than one point in time, indicate the frequency with which the data was collected., that is, monthly, quarterly, or other.', 'Se os dados coletados incluírem mais de um ponto no tempo, indique a frequência com que os dados foram coletados, isto é, mensalmente, trimestralmente ou outro.', '2019-08-07 17:26:02', 0),
(4723, 'socialscience.properties', 'datasetfieldtype.samplingProcedure.description', 'Type of sample and sample design used to select the survey respondents to represent the population. May include reference to the target sample size and the sampling fraction.', 'Tipo de amostra e desenho de amostra usado para selecionar os respondentes da pesquisa para representar a população. Pode incluir referência ao tamanho da amostra alvo e à fração de amostragem.', '2019-08-07 17:26:02', 0),
(4724, 'socialscience.properties', 'datasetfieldtype.targetSampleSize.description', 'Specific information regarding the target sample size, actual  sample size, and the formula used to determine this.', 'Informações específicas sobre o tamanho da amostra alvo, o tamanho real da amostra e a fórmula usada para determinar isso.', '2019-08-07 17:26:02', 0),
(4725, 'socialscience.properties', 'datasetfieldtype.targetSampleActualSize.description', 'Actual sample size.', 'Tamanho real da amostra.', '2019-08-07 17:26:02', 0),
(4726, 'socialscience.properties', 'datasetfieldtype.targetSampleSizeFormula.description', 'Formula used to determine target sample size.', 'Fórmula usada para determinar o tamanho da amostra alvo.', '2019-08-07 17:26:02', 0),
(4727, 'socialscience.properties', 'datasetfieldtype.deviationsFromSampleDesign.description', 'Show correspondence as well as discrepancies between the sampled units (obtained) and available statistics for the population (age, sex-ratio, marital status, etc.) as a whole.', 'Mostrar correspondências, bem como discrepâncias entre as unidades da amostra (obtidas) e as estatísticas disponíveis para a população (idade, razão sexual, estado civil, etc.) como um todo.', '2019-08-07 17:26:02', 0),
(4728, 'socialscience.properties', 'datasetfieldtype.collectionMode.description', 'Method used to collect the data., instrumentation characteristics (e.g., telephone interview, mail questionnaire, or other).', 'Método usado para coletar os dados, Características de instrumentação (por exemplo, entrevista por telefone, questionário de correio ou outro).', '2019-08-07 17:26:02', 0),
(4729, 'socialscience.properties', 'datasetfieldtype.researchInstrument.description', 'Type of data collection instrument used. Structured indicates an instrument in which all respondents are asked the same questions/tests, possibly with precoded answers. If a small portion of such a questionnaire includes open-ended questions, provide appropriate comments. Semi-structured indicates that the research instrument contains mainly open-ended questions. Unstructured indicates that in-depth interviews were conducted.', 'Tipo de instrumento de coleta de dados utilizado. Estruturado indica um instrumento no qual todos os entrevistados são questionados sobre as mesmas questões/testes, possivelmente com respostas pré-codificadas. Se uma pequena parte desse questionário incluir perguntas abertas, forneça comentários apropriados. Semiestruturado indica que o instrumento de pesquisa contém principalmente perguntas abertas. Unstructured indica que entrevistas em profundidade foram realizadas.', '2019-08-07 17:26:02', 0),
(4730, 'socialscience.properties', 'datasetfieldtype.dataCollectionSituation.description', 'Description of noteworthy aspects of the data collection situation. Includes information on factors such as cooperativeness of respondents, duration of interviews, number of call backs, or similar.', 'Descrição de aspectos relevantes da situação da coleta de dados. Inclua informações sobre fatores como cooperatividade dos entrevistados, duração das entrevistas, número de chamadas de retorno ou similares.', '2019-08-07 17:26:02', 0),
(4731, 'socialscience.properties', 'datasetfieldtype.actionsToMinimizeLoss.description', 'Summary of actions taken to minimize data loss. Include information on actions such as follow-up visits, supervisory checks, historical matching, estimation, and so on.', 'Resumo das ações tomadas para minimizar a perda de dados. Inclua informações sobre ações como visitas de acompanhamento, verificações de supervisão, correspondência histórica, estimativa e assim por diante.', '2019-08-07 17:26:02', 0),
(4732, 'socialscience.properties', 'datasetfieldtype.controlOperations.description', 'Control OperationsMethods to facilitate data control performed by the primary investigator or by the data archive.', 'Métodos de operações de controle para facilitar o controle de dados realizado pelo investigador principal ou pelo arquivo de dados.', '2019-08-07 17:26:02', 0),
(4733, 'socialscience.properties', 'datasetfieldtype.weighting.description', 'The use of sampling procedures might make it necessary to apply weights to produce accurate statistical results. Describes the criteria for using weights in analysis of a collection. If a weighting formula or coefficient was developed, the formula is provided, its elements are defined, and it is indicated how the formula was applied to the data.', 'O uso de procedimentos de amostragem pode tornar necessário aplicar pesos para produzir resultados estatísticos precisos. Descreva os critérios para usar pesos na análise de uma coleção. Se uma fórmula de ponderação ou coeficiente foi desenvolvida, a fórmula é fornecida, seus elementos são definidos e é indicado como a fórmula foi aplicada aos dados.', '2019-08-07 17:26:02', 0),
(4734, 'socialscience.properties', 'datasetfieldtype.cleaningOperations.description', 'Methods used to clean the data collection, such as consistency checking, wildcode checking, or other.', 'Métodos usados para limpar a coleta de dados, como verificação de consistência, verificação de código irrelevante ou outros.', '2019-08-07 17:26:02', 0),
(4735, 'socialscience.properties', 'datasetfieldtype.datasetLevelErrorNotes.description', 'Note element used for any information annotating or clarifying the methodology and processing of the study.', 'Elemento de nota usado para qualquer informação anotando ou esclarecendo a metodologia e o processamento do estudo.', '2019-08-07 17:26:02', 0),
(4736, 'socialscience.properties', 'datasetfieldtype.responseRate.description', 'Percentage of sample members who provided information.', 'Porcentagem de membros da amostra que forneceram informações.', '2019-08-07 17:26:02', 0),
(4737, 'socialscience.properties', 'datasetfieldtype.samplingErrorEstimates.description', 'Measure of how precisely one can estimate a population value from a given sample.', 'Medida da precisão com que se pode estimar um valor populacional a partir de uma dada amostra.', '2019-08-07 17:26:02', 0),
(4738, 'socialscience.properties', 'datasetfieldtype.otherDataAppraisal.description', 'Other issues pertaining to the data appraisal. Describe issues such as response variance, nonresponse rate  and testing for bias, interviewer and response bias, confidence levels, question bias, or similar.', 'Outras questões relativas à avaliação de dados. Descreva questões como variação de resposta, taxa de não resposta e teste de viés, viés de entrevistador e resposta, níveis de confiança, viés de pergunta ou similar.', '2019-08-07 17:26:02', 0),
(4739, 'socialscience.properties', 'datasetfieldtype.socialScienceNotes.description', 'General notes about this Dataset.', 'Notas gerais sobre este conjunto de dados.', '2019-08-07 17:26:02', 0),
