(6643, 'Bundle.properties', 'dataset.message.uploadFiles', 'Carica i file del dataset – Puoi trascinare e rilasciare i file dal desktop, direttamente nel widget di caricamento.', 'Carregar arquivos do conjunto de dados - Você pode arrastar e soltar arquivos da área de trabalho diretamente no widget de upload.', '2019-09-25 13:59:47', 0),
