(6640, 'Bundle.properties', 'dataset.manageTemplates.info.message.notEmptyTable', 'Crea, clona, modifica, visualizza o elimina modelli di dataset. Creare un modello di dataset per precompilare i campi di metadati con valori standard, come l´affiliazione dell´autore, per aiutare gli utenti a creare dataset in questo dataverse. Puoi anche aggiungere il testo della guida direttamente nei campi dei metadati per dare agli utenti maggiori informazioni su cosa aggiungere a questi campi.', 'Crie, clone, edite, visualize ou exclua modelos de conjunto de dados. Crie um modelo de conjunto de dados para preencher previamente os campos de metadados com valores padrão, como a afiliação do autor, para ajudar os usuários a criar conjuntos de dados neste inversor de dados. Você também pode adicionar texto de ajuda diretamente aos campos de metadados para fornecer aos usuários mais informações sobre o que adicionar a esses campos.', '2019-09-25 13:59:46', 0),
